import React from 'react';
import './Portfolio.css';

const Portfolio = () => {
    return (
        <section className="portfolio">
            <h2 className="portfolio__title">Портфолио</h2>
            <ul>
                <li><a className="portfolio__link" href="https://latypovroman.github.io/YAPhow-to-learn/">Статичный сайт</a></li>
                <li><a className="portfolio__link" href="https://latypovroman.github.io/russian-travel/">Адаптивный сайт</a></li>
                <li><a className="portfolio__link" href="https://mesto.app.nomoredomains.sbs/">Одностраничное приложение</a></li>
            </ul>
        </section>
    );
};

export default Portfolio;
